      window.reportProps["appData"] = { data: { result: {"view_xml": "\u003cView version=\"1\" fragment=\"false\"\u003e\u003cSelect type=\"tabs\"\u003e\u003cGroup label=\"Event and Country Statistics\" columns=\"1\" valign=\"top\"\u003e\u003cSelect type=\"tabs\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"List of World Championships\" src=\"ref://d9fc3d266f\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"Countries competing at World Championships\" src=\"ref://42f5914ce0\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"Athletes competing at World Championships\" src=\"ref://03175fa61e\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"20 Largest Total Team size at World Championships\" src=\"ref://29b8e847ae\"/\u003e\u003cGroup label=\"2023 Registration Stats\" columns=\"2\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://fad8bf7d2a\" caption=\"Team Sizes\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://69bf084987\" caption=\"Number of Athletes by Discipline and Gender\"/\u003e\u003c/Group\u003e\u003cGroup label=\"2023 Debutants Stats\" columns=\"2\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://858053b99f\" caption=\"First Senior World Event\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://1caeb41c69\" caption=\"First Senior World Event\"/\u003e\u003c/Group\u003e\u003cText label=\"Analysis\"\u003e\u003c![CDATA[### Terminology  \n- An event is a set of competitions taking place at a single Venue over a continuous period.  \n- but in 2014 when the Wchamps were split, if you attended both, then it only counts as 1 wchamps.\n- A competition is for a single discipline for a gender (e.g Boulder female), multiple competitions take place at a single event.  \n\n### Highlights  \n- The most countries ever at a World Champs was 55 in 2011 and 2012, this year with 54 countries is a big increase on 2019 and 2021  \n- The most countries to compete in bouldering and Lead is 51 in 2012 and 2011 respectfully  \n- The most countries to compete in Speed is 38 in 2016  \n- Russia has sent the largest teams to a Wchamps, the largest was 35 in 2018  \n\n- This year is the first time that JPN and USA have the largest teams at a Wchamps both with a squad of 21 athletes  \n\n### Event stuff  \n- 3rd time in Switzerland, only France has hosted more with 4 WChamps, first time in Bern  \n- 18th Wchamps (counting 2014 as one wchamps which was spread over 2 events)]]\u003e\u003c/Text\u003e\u003c/Select\u003e\u003c/Group\u003e\u003cGroup label=\"World Chamionship Competition and Athlete Participation Statistics\" columns=\"1\" valign=\"top\"\u003e\u003cSelect type=\"tabs\"\u003e\u003cGroup label=\"Number of Boulder World Champs attended (male and female) - Top 20\" columns=\"2\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://1c403a26a0\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://1cf063dc84\"/\u003e\u003c/Group\u003e\u003cGroup label=\"Number of Lead World Champs attended (male and female) - Top 20\" columns=\"2\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://56f57ee506\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://de99d23ebf\"/\u003e\u003c/Group\u003e\u003cGroup label=\"Number of Speed World Champs attended (male and female) - Top 20\" columns=\"2\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://d119eb4a66\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://f9effb71c8\"/\u003e\u003c/Group\u003e\u003cGroup label=\"Number of Combined World Champs attended (male and female) - Top 20\" columns=\"2\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://c5d5045ad4\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://131b9014ac\"/\u003e\u003c/Group\u003e\u003cGroup label=\"Number of World Champs all disciplines attended (male and female) - Top 20\" columns=\"2\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://34824128ca\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://6f2fe080b5\"/\u003e\u003c/Group\u003e\u003cText label=\"Highlights\"\u003e\u003c![CDATA[### Boulder  \n- Jain and Petra will be at their 8th Wchamps, 1 behind Akiyo  \n- Jernej and Sean will be at their 9th Wchamps, they hold the joint record  \n\n### Lead  \n- Jain will take the record with her 10th Wchamps in Lead  \n- Jakob and Sean will be at their 9th Wchamps, but the record is 10 Wchamps  \n\n### Speed  \n- Ola will be at her 7th Wchamps, but the record is 9 for women  \n- Marcin DZIENSKI will tie the male record at his 8th Wchamps  \n- Danyil BOLDYREV will tie the male record at his 8th Wchamps  \n\n### Total number of Comps at Wchamps\n- Jain Kim clear leader this will be her 23rd (B), 24th (L) and 25th (B\u0026L) comps at Wchamps\n- Sean McColl clear leader this will be his 28th (B), 29th (L) and 30th (B\u0026L) comps at Wchamps]]\u003e\u003c/Text\u003e\u003c/Select\u003e\u003c/Group\u003e\u003cGroup label=\"Country Results World Champs\" columns=\"1\" valign=\"top\"\u003e\u003cSelect type=\"tabs\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"World Championships Medal Table for Boulder\" src=\"ref://b551a97bd0\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"World Championships Medal Table for Lead\" src=\"ref://ebaadf6caf\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"World Championships Medal Table for Speed\" src=\"ref://7636e41178\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"World Championships Medal Table for Combined\" src=\"ref://165f6c9803\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"World Championships Medal Table for BoulderLead\" src=\"ref://d430a8a54d\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"World Championships Medal Table for All disciplines\" src=\"ref://101f7ec5ed\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"Number of athletes per Country with World Championship wins and podiums for Boulder\" src=\"ref://5dbf6fff8e\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"Number of athletes per Country with World Championship wins and podiums for Lead\" src=\"ref://5ac0393be9\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"Number of athletes per Country with World Championship wins and podiums for Speed\" src=\"ref://ef1553b2bc\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"Number of athletes per Country with World Championship wins and podiums for Combined\" src=\"ref://b9c54ac840\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"Number of athletes per Country with World Championship wins and podiums all disciplines\" src=\"ref://22b74d841b\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"Country best finishes by gender and discipline\" src=\"ref://ea4e6c4983\"/\u003e\u003cText label=\"Highlights\"\u003e\u003c![CDATA[### Medal sets (a set is a medal in boulder,lead,speed for both genders)  \n- No country has a complete gold set of Medals, france is closest with 4, they need female boulder and speed to complete the set, Russia also has 4, they need male and female lead  \n- France has a male half-set of golds  \n- Italy has a female half-set of Golds  \n- USA are probably closest to getting a half-set, they need a female speed gold to complete a female set  \n\n- France is the only country to have a complete set of 6 podiums  \n- Italy have 5 podiums, they need a female speed podium to complete the set  \n- several countries have 4 podiums and have a chance of getting to 5  \n\n### Countries Medal League  \n-  Indonesia don\u0027t have any speed medals, surely that will change, they could leap up the Speed medal table  \n-  Unlikely the top spot on any of the country medal tables will change, but there will be movement within the top 5]]\u003e\u003c/Text\u003e\u003c/Select\u003e\u003c/Group\u003e\u003cGroup label=\"Country Results World Champs per Year\" columns=\"1\" valign=\"top\"\u003e\u003cSelect type=\"tabs\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"World Championships Medal Table for All disciplines per World Championship\" src=\"ref://881b99a424\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"World Championships Medal Table for Boulder\" src=\"ref://e633b4407d\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"World Championships Medal Table for Lead\" src=\"ref://bee58d04e8\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"World Championships Medal Table for Speed\" src=\"ref://03a7018009\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"World Championships Medal Table for Combined\" src=\"ref://7eb83863c7\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"World Championships Medal Table for BoulderLead\" src=\"ref://a79c01b56d\"/\u003e\u003c/Select\u003e\u003c/Group\u003e\u003cGroup label=\"Youngest and Oldest Stats\" columns=\"1\" valign=\"top\"\u003e\u003cGroup columns=\"1\" valign=\"top\"\u003e\u003cText\u003e\u003c![CDATA[**Please treat the finalist and attendee data with caution as there are many athletes without a DoB**  \n    Phrase in a way that says we know of people who were atleast xx years old but we don\u0027t have a definitive youngest/oldest person  \n    Winner and Podium data is nearly 100% complete, so small chance of an error\n\nYoungest]]\u003e\u003c/Text\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://3509a0d35a\" caption=\"results including 2023 World Champs\"/\u003e\u003cText\u003e\u003c![CDATA[Oldest]]\u003e\u003c/Text\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://c270ee5d68\" caption=\"results including 2023 World Champs\"/\u003e\u003c/Group\u003e\u003c/Group\u003e\u003cGroup label=\"Athlete Results\" columns=\"1\" valign=\"top\"\u003e\u003cSelect type=\"tabs\"\u003e\u003cGroup label=\"World Championship Boulder wins and podiums (male and female)\" columns=\"2\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://6129dd7f9e\" caption=\"results including 2023 World Champs\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://bec7d304a9\" caption=\"results including 2023 World Champs\"/\u003e\u003c/Group\u003e\u003cGroup label=\"World Championship Lead wins and podiums (male and female)\" columns=\"2\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://7d3d98221e\" caption=\"results including 2023 World Champs\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://bb73e944d4\" caption=\"results including 2023 World Champs\"/\u003e\u003c/Group\u003e\u003cGroup label=\"World Championship Speed wins and podiums (male and female)\" columns=\"2\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://ecf95b2ca0\" caption=\"results including 2023 World Champs\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://448303f739\" caption=\"results including 2023 World Champs\"/\u003e\u003c/Group\u003e\u003cGroup label=\"World Championship Combined wins and podiums (male and female)\" columns=\"2\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://d9fdcfe27a\" caption=\"results including 2023 World Champs\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://3675fe8adc\" caption=\"results including 2023 World Champs\"/\u003e\u003c/Group\u003e\u003cGroup label=\"World Championship all disciplines wins and podiums (male and female)\" columns=\"2\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://84ef654ebe\" caption=\"results including 2023 World Champs\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://387e3714ad\" caption=\"results including 2023 World Champs\"/\u003e\u003c/Group\u003e\u003cGroup label=\"World Championship Boulder podium list (male and female)\" columns=\"1\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://76a8755bb3\" caption=\"Boulder\"/\u003e\u003c/Group\u003e\u003cGroup label=\"World Championship Lead podium list (male and female)\" columns=\"1\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://5bf347e9d4\" caption=\"Lead\"/\u003e\u003c/Group\u003e\u003cGroup label=\"World Championship Speed podium list (male and female)\" columns=\"1\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://bc59910328\" caption=\"Speed\"/\u003e\u003c/Group\u003e\u003cText\u003e\u003c![CDATA[### Country  \n- No medals for Indonesia, they must have a good chance in speed  \n\n### Female  \n- Janja has most golds across all disciplines (6)  \n- Janja and Akiyo tied on 7 medals  \n\n**Boulder** \n- Janja could overtake Anna Stohr and have the most golds in Bouldering if she wins (3)  \n- Natalia could get a 2nd boulding gold and match Anna and Janja  \n\n**Lead**  \n- Janja could take a 3rd lead Gold, but would still be behind Angela Eiter (4)  \n- Jain, Chaehyun and Jessie all have a chance to win a 2nd Gold and match Janja  \n\n**Speed**  \n- Ola could win a 3rd Gold and match the female reorc in Speed of Olena  \n- Natalia K could win a 2nd Gold and match Ola  \n- Everyone else would be a new winner  \n\n### Male  \n- Adam, Jakob and Qixin tied on most Golds across all disciplines
